&gt;In 2010, Riley married billionaire entrepreneur Elon Musk at Dornoch Cathedral.[11] In 2012, it was reported that they were seeking a divorce.[12] She settled for $4.2 million at the time.[13]
&gt;
&gt;In a 60 Minutes interview in 2014, the couple stated that they had reconciled and were living together again, along with Musk's five children from his first marriage to writer Justine Musk.[14] On December 31, 2014, the Associated Press reported that Musk had filed for divorce again.[15] In the December 31, 2014 split and pending divorce Musk agreed to give her $16 million in cash and assets.[16] As of August 2015, however, the couple remain married.
